const Render = () => {
    const Snapchat = () => {<a href="https://www.snapchat.com/add/irish_voxel" className='underline'/>}
    return (
        <div className='bg-gray-200 p-8'>
            <div className='text-gray-600 font-medium text-base leading-relaxed'>Developed and coded by <Snapchat /></div>
        </div>
    )
}

export default Render
